import React from 'react';
import WebcamSvg from '../assets/live.png';

function WebCam() {
  return (
    <div className="status-box">
      <p className="value"><img src={WebcamSvg} /><br /> <span className="value-text">Webbkameror</span></p>
    </div>
  )
}

export default WebCam
